import './App.css';
import ComponentePregunta from './Componentes/ComponentePregunta';
import {createRoutesFromElements , createBrowserRouter , RouterProvider , Route} from 'react-router-dom'

import Encabezado from './Componentes/Encabezado';
import IniciarTest from './Componentes/IniciarTest';
import ListaPreguntas from './Preguntas/preguntas';



function App() {

  const router = createBrowserRouter(
    createRoutesFromElements(
      <Route path="/" element={<Encabezado/>}>
        <Route path='' element={<IniciarTest/>} >
          <Route path=':hola' element={<ListaPreguntas/>} />  
        </Route>

      </Route>
    )
  )

  return (
    <div className="App">
      <RouterProvider router={router}/>
      {/* <header>
        <h1>Test de conocimientos de JavaScript</h1>
      </header>     
      <ComponentePregunta/> */}
    </div>
  );
}

export default App;
